import React, { useState, useEffect, setTodos } from "react";

import axios from "axios";


export default function Gettododata(props) {

  const [data, setData] = useState({ todos: [] });


  useEffect(async () => {

    fetch("http://127.0.0.1:5000/api/v1/car/catalog", 
        {
        method: 'GET',
        }
          ).then(res=>{
            if(res.ok){
                return res.json()
            }else{
                alert("something is wrong")
            }
        }).then(data =>{
            //token = localStorage.getItem('token');
            setTodos(data);

            //document.querySelector("#firstName").placeholder = data["firstName"];
            }
        ).catch((err) => {
            console.error(err)
        }
        );

    

  }, []);


  return (

    <div>

      {data.todos.map(item => (

        <div key={item.id}>

          <p>{item.title}</p>

        </div>

      ))}

    </div>

  );

}
